<?php declare(strict_types=1);

namespace EdituraEDU\ANAF\Tests\RequestTests;

use Throwable;

class UploadUBLTest extends RequestTestBase
{
    const VALID_UBL = "";

    public function testUploadUBL(): void
    {
        if(getenv("ANAF_EMPTY_LIST_ONLY")=="true")
        {
            $this->markTestSkipped("ANAF_EMPTY_ONLY is set, skipping");
        }
        try {
            $client = $this->createClient();
            $ubl = base64_decode(UploadUBLTest::VALID_UBL);
            $response = $client->UploadEFactura($ubl, "" . $this->cif);
        } catch (Throwable $ex) {
            $this->fail("Exception thrown: " . $ex->getMessage());
        }
        $this->assertTrue($response->IsSuccess(), "Failed to upload UBL");
        $this->assertIsNumeric($response->IndexIncarcare);
        $this->assertGreaterThan(0, $response->IndexIncarcare);
        $this->assertIsInt($response->ResponseTimestamp);
        $this->assertGreaterThan(0, $response->ResponseTimestamp);
    }
}